export const Form = () => {
  return (
    <form className="form__container">
      <div className="description">
        <label htmlFor="description">Descrição</label>
        <input type="text" name="description" id="description" />
        <span>Ex: Compra de roupas</span>
      </div>
    </form>
  );
};
